  02> WILLIAMS, Fiona Margaret and MAITAI, Matau
  b 21.04.1958
  b ** ** ****
  Fiona b. at Gisborne. Address: 37 Solander Street, Tolaga Bay, Gisborne.
  Fiona was educated at Queenswood (1969-70) and Woodford House (1971-74). She was a Rotary Exchange
  Student in Florida in 1975 and completed a course at Wellington Polytechnic in 1976. She worked at
  the National Museum of New Zealand in Wellington as secretary to the Director. Later she was
  receptionist, secretary and word processor operator for law firms in Gisborne, Napier and Auckland.
  During 1980-81 she was overseas in USA, England, Scandanavia and Europe.
  Fiona has been active in Te Kohanga Reo (Chairman of Hauiti Te Kohanga Reo for two years) and is
  presently on the Board of Trustees of the Tolaga Bay Area School. She has been Secretary of
  Eastland Cake Decorators Guild for three years, and Treasurer of the Uawa Swimming Club for one
  year. She has taken courses in such subjects as upholstery, public speaking, Te Reo, and various
  crafts. She was a professional cake decorator for eight years and a professional machine knitter
  for four years. She is presently in the third year of a Bed and DipTchng through a combination of
  on-campus and extramural studies with both Waikato and Massey Universities.
  Matau is a diesel mechanic and works for the local bus company. His is active in the volunteer
  fire brigade (7 years) and the local youth club (6 years).
  01> WILLIAMS, Jessica Elizabeth
  b 09.10.1985
  Jessica b. at Auckland. She attend Kohanga and is fluent in Te Reo.
  02> WILLIAMS, Katerina Milner
  b 07.10.1989
  Katerina b. at Auckland. She is in immersion education at Kohanga.
  03> WILLIAMS, Philip John
  b 28.06.1960
  Philip b. at Gisborne. Address: 26 Norwich Crescent, Tamatea, Napier.
  Philip is involved with several community groups including the Epilepsy Association. He is doing
  accounts work for the Disability Information Trust and is involved in the Hawkes Bay Revival
  Centre. He writes, "We believe that the Bible is infallible and that a person has to repent to be
  baptised, and will receive the Holy Spirit with the evidence of speaking in tongues."
  04> WILLIAMS, Jennifer Lillian m on 18.04.1987 to GORDON, David John
  b 08.12.1961
  b 29.02.1960
  Jennifer b. at Tolaga Bay and m. at Tauranga. David, s/o Rev DB Gordon and M Pitcher, b. at
  Dunedin. Address: 114 White Swan Road, Mt Roskill, Auckland.
  Jennifer was educated at Queenswood and Woodford House where she enjoyed participating in sports,
  music and drama and the Maori Culture Group. She represented the school at tennis, netball,
